import React from "react";
import "./trending.css";

const Trending = () => {
  return (
    <div class="trending-container p-4">
      <div className=" grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 lg:grid-cols-5 xl:grid-cols-6 gap-1 flex items-center">
        <div>
          <div className="trending-card bg-blue-500">
            <div className="trending-img ">
              <img
                src="/assets/images/hxh.jpg"
                alt=""
                className="w-44 h-64 object-cover"
              />
            </div>
            <div className="trending-info bg-red-900 w-44">
              <div className="title">Battle Through The Heavens 5th Season</div>
            </div>
            <div class="footer bottom-section">footer</div>
          </div>
        </div>
        <div className=" bg-blue-500 flex justify-center">
          <div>test</div>
        </div>
      </div>
    </div>
  );
};

export default Trending;
